function parseCSV(csv: string): BotRecord[] {
  const lines = csv.split('\n');
  const data: BotRecord[] = [];
  
  // Skip header, handle quoted fields with commas
  for (let i = 1; i < lines.length; i++) {
    const line = lines[i].trim();
    if (!line) continue;
    
    // Regex to properly split CSV with potential quoted strings containing commas
    const parts: string[] = [];
    let current = '';
    let inQuote = false;
    
    for (let j = 0; j < line.length; j++) {
      const char = line[j];
      if (char === '"') {
        inQuote = !inQuote;
      } else if (char === ',' && !inQuote) {
        parts.push(current.trim());
        current = '';
      } else {
        current += char;
      }
    }
    parts.push(current.trim());

    if (parts.length < 6) continue;

    const tags = parts[2]
      ? parts[2].replace(/^"|"$/g, '').split(',').map(t => t.trim()).filter(t => t) 
      : [];

    data.push({
      botName: parts[0],
      developer: parts[1],
      tags: tags,
      myshellUrl: parts[3],
      note: parts[4],
      launchDate: parts[5]
    });
  }
  return data;
}

